import React from 'react';

function Member(props) {
  return (
      <div className='col-lg-3 col-md-6 col-sm-6 col-xs-12'>
          <div className='card'>
              <div className='card-header'>
                <img src={props.img} alt='avatar' style={{maxWidth: '100%'}}/>
              </div>
              <div className='card-body' style={{backgroundColor: props.name === 'Hesham' ? 'darkGreen' : '#777', color: 'black', textAlign: 'center'}}>
                <h2>{props.name}</h2>
                <h3>{props.title}</h3>
                <p>{props.phone}</p>
                <p>{props.mail}</p>
              </div>
          </div>
      </div>
  )
}

export default Member;
